(27,	'COBRO PREJURIDICO 1',	'001',	'F-GSL-001',	'2018-01-02',	'<p style=margin-left:0cm; margin-right:0cm; text-align:justify><span style=font-size:11pt><span style=font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;><strong><span style=font-size:10.0pt><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>Fundamento Legal</span></span></strong><span style=font-size:10.0pt><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>: </span></span></span></span></p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify><span style=font-size:11pt><span style=font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;><strong><span style=font-size:10.0pt><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>C&oacute;digo de Comercio</span></span></strong><span style=font-size:10.0pt><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>: Arts. 864, 850, 851, 852, 853 y 884</span></span></span></span></p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify><span style=font-size:11pt><span style=font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;><strong><span style=font-size:10.0pt><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>C&oacute;digo Civil</span></span></strong><span style=font-size:10.0pt><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>: Arts. 1602, 1603, 1604, 1608 n&uacute;m. 1&ordm; y 2&ordm;, 1609, 1610 n&uacute;m. 3&ordm;, 1615, 1616, 1617 y 2232.</span></span></span></span></p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify>&nbsp;</p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify><span style=font-size:11pt><span style=font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;><span style=font-size:10.0pt><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>Conocedores de lo importante que representa para usted, su imagen crediticia y de lo que conlleva a un mejoramiento continuo en cuanto a las relaciones comerciales se refiere, nuestra Instituci&oacute;n lo invita a presentarse a la Central de Cartera ubicado en la Direcci&oacute;n: Carrera 4 N&deg; 0-93 Edificio Panorama-Popay&aacute;n Cauca, para dar cumplimiento oportuno a su compromiso comercial que se encuentra vencido; la cual se dar&aacute; aplicaci&oacute;n de car&aacute;cter supletorio con fundamento en las normas Comercial y Civil. En caso contrario le invitamos a comunicarse al tel&eacute;fono <strong>3146873552</strong>, para que reporte dentro del mes su respectiva fecha de pago, o en su defecto a las siguiente ruta electr&oacute;nica: </span></span><a href=mailto:carteraguapi2016@gmail style=color:blue; text-decoration:underline><strong><span style=font-size:10.0pt><span style=background-color:white><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>carteraguapi2016@gmail</span></span></span></strong></a><strong><u><span style=font-size:10.0pt><span style=background-color:white><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>.com</span></span></span></u></strong><u> </u><span style=font-size:10.0pt><span style=background-color:white><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>incumplimiento de la obligaci&oacute;n de pagar por la prestaci&oacute;n del servicio de la Empresa Social del Estado HOSPITAL GUAPI puede acarrear la imposici&oacute;n de la sanci&oacute;n prevista en la ley, consistente en el pago, recordando que </span></span></span><span style=font-size:10.0pt><span style=background-color:white><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;><span style=color:black>no hay raz&oacute;n alguna que haga inconstitucional la aplicaci&oacute;n de dicha sanci&oacute;n pues se trata de una consecuencia que deviene del incumplimiento de la obligaci&oacute;n de pagar una suma de dinero.</span></span></span></span></span></span></p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify>&nbsp;</p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify><span style=font-size:11pt><span style=font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;><span style=font-size:10.0pt><span style=background-color:white><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;><span style=color:black>La Sentencia C-389 de 2002, proferida por la Honorable Corte Constitucional en aparte jurisprudencial se desprende que el cobro de intereses de mora es facultativo y no obligatorio. En efecto, el legislador utiliz&oacute; el verbo&nbsp;<strong><u>podr&aacute;n</u></strong>, dejando a la empresa prestataria del servicio <strong><u>la facultad</u>&nbsp;</strong>de cobrarlos, rebajarlos o exonerarlos o hacer convenios con los deudores.</span></span></span></span></span></span></p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify>&nbsp;</p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify><span style=font-size:11pt><span style=font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;><span style=font-size:10.0pt><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>De otra parte, le informo que la Empresa Social del Estado HOSPITAL GUAPI, se encuentra vinculada al programa de Centrales de Riesgo DATACREDITO y CIFIN, reportando el comportamiento de pago de la obligaci&oacute;n en menci&oacute;n.</span></span></span></span></p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify>&nbsp;</p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify><span style=font-size:11pt><span style=font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;><span style=font-size:10.0pt><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>Si&nbsp;ya&nbsp;cancelo&nbsp;por&nbsp;favor&nbsp;haga&nbsp;caso&nbsp;omiso&nbsp;a&nbsp;esta&nbsp;comunicaci&oacute;n, sin otro en particular&nbsp;</span></span></span></span></p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify>&nbsp;</p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify><span style=font-size:11pt><span style=font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;><span style=font-size:10.0pt><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>Cordialmente,</span></span></span></span></p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify>&nbsp;</p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify>&nbsp;</p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify><span style=font-size:11pt><span style=font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;><strong><span style=font-size:10.0pt><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>JOHN DIRLEY MORALES</span></span></strong></span></span></p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify><span style=font-size:11pt><span style=font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;><span style=font-size:10.0pt><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>Jefe de Cartera </span></span></span></span></p>\r\n\r\n<p style=margin-left:0cm; margin-right:0cm; text-align:justify><span style=font-size:11pt><span style=font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;><span style=font-size:10.0pt><span style=font-family:&quot;Arial&quot;,&quot;sans-serif&quot;>Empresa Social del Estado HOSPITAL GUAPI</span></span></span></span></p>\r\n',	'',	'2020-07-25 15:03:57',	'2020-07-25 10:03:57'),
